import React, { useState } from 'react';
import Sidebar from '../components/Dashboard/Sidebar';
import '../components/Dashboard/Dashboard.css';

const SettingsProfilePage = () => {
  // Mock profile data
  const [profile, setProfile] = useState({
    garageName: 'AAA Auto Garage',
    contactEmail: 'garage@example.com',
    phone: '+971 555 123 456',
    address: 'Dubai, UAE',
    timezone: 'Gulf Standard Time'
  });
  const [saving, setSaving] = useState(false);
  const [saved, setSaved] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile(p => ({ ...p, [name]: value }));
    setSaved(false);
  };

  const handleSave = (e) => {
    e.preventDefault();
    setSaving(true);
    setTimeout(() => { setSaving(false); setSaved(true); }, 600); // mock save
  };

  return (
    <div className="dashboard-layout dashboard-tight">
      <Sidebar />
      <div className="dashboard-layout-main">
        <div className="dashboard-layout-content">
          <div className="settings-profile-wrapper">
            <div className="settings-card">
              <div className="settings-card-header">
                <span className="bar" aria-hidden="true" />
                <h2>Profile Settings</h2>
              </div>
              <form className="settings-form" onSubmit={handleSave}>
                <div className="settings-form-grid">
                  <label className="settings-field">
                    <span className="settings-label">Garage Name</span>
                    <input name="garageName" value={profile.garageName} onChange={handleChange} />
                  </label>
                  <label className="settings-field">
                    <span className="settings-label">Contact Email</span>
                    <input name="contactEmail" type="email" value={profile.contactEmail} onChange={handleChange} />
                  </label>
                  <label className="settings-field">
                    <span className="settings-label">Phone</span>
                    <input name="phone" value={profile.phone} onChange={handleChange} />
                  </label>
                  <label className="settings-field">
                    <span className="settings-label">Address</span>
                    <input name="address" value={profile.address} onChange={handleChange} />
                  </label>
                  <label className="settings-field">
                    <span className="settings-label">Timezone</span>
                    <input name="timezone" value={profile.timezone} onChange={handleChange} />
                  </label>
                </div>
                <div className="settings-actions">
                  <button type="submit" className="settings-primary-btn" disabled={saving}>{saving ? 'Saving...' : 'Save Changes'}</button>
                  {saved && <span className="settings-save-indicator" role="status">Saved</span>}
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SettingsProfilePage;
